import { faCirclePlay, faStar } from "@fortawesome/free-regular-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import React from "react";

const MovieCart = () => {
  return (
    <div className="page-container">
      <div className="movieList flex items-center justify-center gap-6 flex-wrap">
        <div className="movieItem text-white w-[250px] p-3 rounded-lg border border-gray-600 bg-slate-800">
          <img
            className="w-full h-[250px] object-cover rounded-lg"
            src="https://4.bp.blogspot.com/-m7qzhWsqRAY/XLSQM2nZ7nI/AAAAAAAAM_4/mPq4c-7UBkEpBMX-FAcgnVGP6TBlAWy_ACLcBGAs/s2560/marvel-spiderman-new-4k-6b-2048x2048.jpg"
            alt=""
          />
          <h3 className="py-2 text-lg">Spiderman: Homecoming </h3>
          <div className="flex items-center justify-between">
            <span className="text-gray-400">2017</span>
            <span>
              7.4
              <FontAwesomeIcon icon={faStar} className="text-yellow-400 ml-2" />
            </span>
          </div>
          <div className="watch bg-primary w-full mt-4 h-[50px] px-8 rounded-lg flex items-center justify-center cursor-pointer text-xl font-semibold gap-2">
            <h2>Watch Now</h2>
            <FontAwesomeIcon icon={faCirclePlay} className="text-3xl" />
          </div>
        </div>
      </div>
    </div>
  );
};

export default MovieCart;
